
--------------------------------------------------------
--  DDL for Table StoreFile [매장 이미지파일]
--------------------------------------------------------

create table storeFile (
    fileNum number constraint sf_fn_pk primary key,
    storeCode number constraint sf_sc_fk references store(storeCode) NOT NULL,
    defaultFile varchar2(1000) NOT NULL,
    etcFile varchar2(4000)
);


-- seq
create SEQUENCE storeFile_seq
    increment by 1
    start with 1471
    nomaxvalue
    nominvalue
    nocycle
    nocache
;

